import MainContent from "./MainContent";
import Navbar from "./Navbar";

interface LayoutProps {
    children: React.ReactNode;
}

const Layout = (props: LayoutProps) => {
  return (
    <>
      <Navbar />
      <MainContent>
        {props.children}
      </MainContent>
    </>
  );
};

export default Layout;
